import React, { useEffect } from 'react';
import { Link, useParams } from 'react-router-dom';
import userIcon from '../components/images/user.svg';

const UserProfile = (props) => {
    const { id, age, location, gender, education, condition } = props;

    let backLink;

    // Determine the destination based on the condition
    if (condition === '1') {
      backLink = `/chatbot/${id}/${age}/${location}/${gender}/${education}/${condition}`;
    } else if (condition === '2') {
      backLink = `/news-preferences/${id}/${age}/${location}/${gender}/${education}/${condition}`;
    }
  return (
    <div>
    {backLink && <Link to={backLink} className="go-back-button">Go Back</Link>}
      <h1>Jouw profiel</h1>
      <div>
        {/* Display user icon/avatar */}
        <img src={userIcon} alt="User Icon" />
      </div>
      <div>
        {/* Display additional profile details from URL */}
        <p>ID: {id}</p>
        <p>Leeftijd: {params.age}</p>
        <p>Locatie: {params.location}</p>
        <p>Geslach: {params.gender}</p>
        <p>Onderwijs: {params.education}</p>
        <p>Voorwaarde: {params.condition}</p>
      </div>
    </div>
  );
}

export default UserProfile;
